(5, 4, 21, 24, 1, 'Palak', 'single', '', 'Fresh greeny vegetable', 0, '2015-12-23 12:51:10', '2015-12-23 12:54:03'),
(6, 4, 21, 24, 5, 'Ginger', 'single', '', ' Ginger is frequently referred to as a root, but it is actually an underground stem (called rhizome). Ginger is a supple ingredient that can be consumed in drinks (tea, beer, ale) or in cooking. It can be utilized to make foods peppery and even as a food preservative. If you prefer it in food, ginger is superb in many dishes and is ideal when combined with garlic. ', 0, '2015-12-23 13:11:38', '2015-12-23 13:49:44'),
(7, 6, 21, 24, 0, 'Curry Leaves', 'single', '', 'Curry leaves contain dark green, shiny, aromatic leaves and release a tasty aroma when fried in hot oil. They can be utilized fresh or dried. These are utilized not just for the taste that they add, but also their several health benefits. These are wealthy in carbohydrates, antioxidants and minerals such as copper, calcium, phosphorous, magnesium and iron. Vitamins A, E, B and C are also some of the important nutrients present.', 1, '2015-12-23 13:13:25', '2015-12-23 14:06:35'),
(15, 8, 21, 26, 5, 'Fresho Broccoli', 'multiple', '', 'resho Broccoli\r\n\r\nAboutBENEFITS HOW TO USE\r\nBroccoli is a green vegetable which closely resembles the cauliflower and belongs to the same family also, collectively known as cruciferous vegetables. 100 gms of broccoli contains just 35 calories.', 1, '2015-12-23 14:10:21', '2015-12-23 14:10:21'),
(8, 7, 3, 4, 5, 'Organic Banana', 'single', '', 'Organic Banana', 1, '2015-12-23 13:14:02', '2015-12-23 13:14:02'),
(9, 8, 21, 24, 5, 'Amaranth Leaves', 'single', '', 'Amaranthus leaves are nutritionally similar to beets, swiss chard and spinach, but are much superior. It is an excellent source of carotene, iron, calcium, protein, vitamin C and trace elements. It is also high in potassium, zinc, Vitamin B and E and can contain over 20% protein.', 1, '2015-12-23 13:16:31', '2015-12-23 13:16:31'),
(10, 7, 3, 4, 5, 'Large Navel Orange', 'single', '', 'Large Navel Orange', 1, '2015-12-23 13:21:33', '2015-12-23 13:22:22'),
(11, 7, 3, 4, 5, 'Red Leaf Lettuce', 'multiple', '', 'Red Leaf Lettuce', 1, '2015-12-23 13:29:12', '2015-12-23 13:30:42'),
(12, 8, 21, 24, 5, 'Fresho Spring Onion', 'single', '', 'Spring onions are an especially popular vegetable and they appear in special varieties including white, yellow and red. They moreover contain Vitamin A and Vitamin K. It also contains Folate & Vitamins C and little amounts of B vitamins like riboflavin, Thiamin & N', 1, '2015-12-23 13:54:31', '2015-12-23 13:54:31'),
(13, 8, 21, 24, 5, 'Fresho Mint ', 'multiple', '', 'Mint Grade A is the volatile oil,menthol that provides mint its characteristic taste. With its distinct aroma, pleasing taste, cool after-sensation and medicinal qualities, mint is among the most well-liked herbs that are grown around the world. It is wealthy in Vitamins especially Folate & Vitamin A, C, and also includes the B- vitamins B1, B3, B2 & B6. The main essential oil in mint is menthol that provides it, its characteristic flavor &', 1, '2015-12-23 13:57:21', '2015-12-23 13:57:21'),
(14, 8, 21, 25, 5, 'Fresho Chilli Bajji Yellow Wax ', 'multiple', '', 'Fresho is our brand of fresh fruits and vegetables which are individually handpicked everyday by our experienced and technically competent buyers. Our buying, storing and packaging processes are tailored to ensure that only the fresh, nutrient dense, healthy and delicious produce reaches your doorstep. We guarantee the quality of all Fresho products. If you''re not satisfied with the freshness of the items, you can hand them back to our Customer Experience Executive (CEE) for a full refund.', 1, '2015-12-23 14:01:14', '2015-12-23 14:01:14'),
(16, 8, 21, 27, 5, 'Fresho Colocasia', 'multiple', '', 'Colocasia also called Taro Root is a starchy, fleshy underground root. It is filled with numerous nutrients and is devoted as a staple food. Colocasia is a stuffy globular fleshy taproot of aroid family. It is oval or globular in figure with a hairy coating on its skin and a whitish yellow flesh. The external skin is first take away before using it for any preparation.', 1, '2015-12-23 14:14:15', '2015-12-26 21:24:58'),
(17, 4, 21, 25, 5, 'chilli green', 'single', '', ' Green chillies have an attractive fresh flavor and a sharp bite. These chillies have rich vitamin a and vitamin c content. We can''t think of Indian food preparation without a dash of green chillies. ', 0, '2015-12-23 14:16:17', '2015-12-23 14:16:17'),
(18, 4, 21, 26, 5, 'Capsicum-Yellow', 'multiple', '', 'Red capsicums are red, thin smooth skinned, crunchy, mildly sweet tasting, hollow vegetables that are juicier variants of the green capsicum. They are a rich source of antioxidants, carotenoids and vitamins C, K, B6 and A. They are high in water content and dietary fibre and potassium, and are cholesterol-free.', 0, '2015-12-23 14:19:13', '2015-12-23 14:21:42'),
(19, 8, 23, 29, 6, 'Chupa Chups Mega Chups Bulk', 'single', '', 'Chupa Chups (/ˈtʃʌpə tʃʌps/; Spanish pronunciation: Spanish: [ˈtʃupa ˈtʃups];) is a popular Spanish brand of lollipop and other confectionery sold in over 150 countries around the world. The brand was founded in 1958 by Enric Bernat, and is currently owned by the Italian multinational corporation Perfetti Van Melle. ', 1, '2015-12-23 14:20:45', '2015-12-23 14:20:45'),
(20, 4, 21, 26, 5, 'Capsicum-Red', 'single', '', 'Red capsicums are red, thin smooth skinned, crunchy, mildly sweet tasting, hollow vegetables that are juicier variants of the green capsicum. They are a rich source of antioxidants, carotenoids and vitamins C, K, B6 and A. They are high in water content and dietary fibre and potassium, and are cholesterol-free.', 0, '2015-12-23 14:21:01', '2015-12-23 14:21:01'),
(21, 8, 23, 30, 6, 'Zaini Disney - 60 gm Carton', 'single', '', 'Chocolate Surprise Eggs And 3D Toy Collection', 1, '2015-12-23 14:24:05', '2015-12-23 14:24:05'),
(22, 4, 21, 27, 5, 'Carrot', 'single', '', 'The carrot is a root vegetable lengthy, narrow and cylindrical/cone shaped generally bright orange in color & available during the year. Naturally sweet, and crispy, carrots are healthy additions you can make to the vegetable list in your diet as they include several health benefiting nutrients such as anti-oxidants, vitamin A, minerals & beta-carotenes in ample amounts. ', 0, '2015-12-23 14:24:24', '2015-12-23 14:24:24'),
(23, 8, 23, 31, 6, 'Ferrero Collection T20', 'single', '', 'Suitable for Gifting', 1, '2015-12-23 14:27:28', '2015-12-23 14:27:28'),
(24, 4, 21, 27, 5, 'beetroot', 'single', '', 'Beetroot also called beet, is a firm, globe shaped root vegetable characterized by dark purple skin and a distinctive purple flesh. Beet has a unique salty-sweet taste. Beetroot is usually consumed after peeling off its skin ( though many prefer to use it unpeeled too). ', 0, '2015-12-23 14:27:41', '2015-12-23 14:27:41'),
(25, 4, 21, 28, 5, 'Ladis finger', 'single', '', 'Ladies Finger is an edible pea pod and although can be eaten as raw or fresh. It is a wonderful supply of important vitamins such as vitamins A, C, K, E, and B complex, as well as iron, potassium, calcium, copper, sodium, selenium, magnesium, manganese and zinc. It is also low in calories and rich in dietary fiber. ', 0, '2015-12-23 14:29:33', '2015-12-23 14:29:33'),
(26, 4, 23, 29, 5, 'Chupa Chips', 'single', '', 'Suitable for Gifting ', 0, '2015-12-23 14:37:30', '2015-12-23 14:38:39'),
(27, 4, 23, 29, 5, 'Dark chocolate', 'single', '', 'Excellent taste', 0, '2015-12-23 14:41:37', '2015-12-23 14:41:37'),
(28, 8, 23, 32, 6, 'Cadbury Dairy Milk', 'single', '', 'Suitable for Gifting', 1, '2015-12-23 14:42:57', '2015-12-23 14:42:57'),
(29, 8, 23, 33, 6, 'Dentyne Sugarfree Gum - Ice Arctic Chill', 'single', '', 'Before Introducing Yourself, Get Intense Freshness From A Bold, Icy Flavor.', 1, '2015-12-23 14:57:10', '2015-12-23 14:57:10'),
(30, 5, 21, 24, 5, 'Fresho Basale Leaf', 'single', '', 'Bachalakura is a high protein, vegan, heart warming dish loaded with nutritious greens. These protein-rich, vibrant green, glossy leaves are thick with a spongy texture. It is a dark green leafy vegetable that is high in nutritional content. It is low in calories and packs protein and fiber.', 1, '2015-12-23 14:59:13', '2015-12-23 14:59:13'),
(31, 8, 23, 32, 6, 'Delaviuda Chocolate Bar', 'single', '', 'The Classic Milk Chocolate Flavour, With No Added Sugars.', 1, '2015-12-23 15:02:17', '2015-12-23 15:02:17'),
(32, 5, 21, 25, 5, 'Birds Eye Chilly-Red', 'single', '', 'These Birds Eye Red Chilies are very tiny conical chillies ranging from tiny, slightly tapered fruit. They grow to become bright scarlet red with time. These Birds Eye Red Chillies are easy to grow and extremely nice shape. It is a Thai cultivar and contains amazingly high levels of vitamins and minerals. It is a wealthy source of vitamin A, vitamin-C, and flavonoids like -carotene, ?-carotene, zea-xanthin, cryptoxanthin and lutein.\r\n\r\nA Zero Pesticide produce from First Agro, Indias first commercial grower organization with Zero Pesticide produce complying to WHOs Codex Alimentarius the highest food safety standard globally.', 1, '2015-12-23 15:04:03', '2015-12-26 20:18:03'),
(33, 5, 21, 26, 5, 'Fresho Baby Potato', 'single', '', 'Baby potatoes usually have a soft brown thin external skin with a creamy off white interior. It has a sweeter taste. It is really rich in Vitamin B6 and C, phytochemical antioxidants similar to flavonoids, other B vitamins as well as folate, and includes small quantities of Vitamin K.', 1, '2015-12-23 15:09:31', '2015-12-26 20:24:25'),
(34, 8, 22, 34, 6, 'Danima Cookies - Butter', 'single', '', 'Danish Recipe Cookies With Butter Content', 1, '2015-12-23 15:09:34', '2015-12-23 15:09:34'),
(35, 8, 22, 35, 6, 'Sapphire Vege Crackers - Original', 'single', '', 'heat Flour, Vegetables Oil & Shortening (Palm Oil), Choco Milk Powder, Sugar, Salt, Corn Starch, Yeast, Leavening Agent, Sodium Bicarbonate[E500, Acids Sodium pyrophosphate [450(ii), Dehydrate Vegetables.', 1, '2015-12-23 15:12:11', '2015-12-23 15:12:11'),
(36, 4, 23, 30, 5, 'Chocolate delight box', 'single', '', 'Contains\r\nAn elegant gift box containing 9 chocolates- 6 assorted truffle, 2 milk chocolate and 1 paan gulkand ice cool chocolate.', 0, '2015-12-23 15:12:14', '2015-12-23 15:12:14'),
(37, 8, 22, 36, 6, 'Gourmets Delite Gourmets Delite Wafers', 'single', '', 'heat Flour (33%), Sugar (29%), Edible Vegetable Fat (19%), Edible Starch (14%), Edible Vegetable Oil, Glucose, Emulsifier(INS 322), Edible Common Salt, Acidity Regulator (E330), Raising Agents [INS 500(II) & 503(II), Dough Conditioner (INS 223), Contains Permitted Synthetic Food Colour (INS 124), Contain Added Flavour-Artificial Flavouring Substance (Chocolate).', 1, '2015-12-23 15:15:18', '2015-12-23 15:15:18'),
(38, 4, 23, 31, 5, 'Chocolate marble', 'single', '', 'Contains\r\na mixture of white and milk chocolate.', 0, '2015-12-23 15:15:50', '2015-12-23 15:15:50'),
(39, 5, 23, 32, 6, 'Tango Chocolate - Cranberry Neapolitan', 'single', '', 'sugar, Refined Palm Kernel Fat, Milk Solids, Cocoa Powder, Hazel Paste, Emulsifier (E322), Permitted Flavour (Cranberry, Vanillin, Vanilla) and Permitted Natural Antioxidant (E306), This food contain milk products and Soybean products, May Contain traces of nuts.', 1, '2015-12-23 15:16:01', '2015-12-26 20:14:33'),
(40, 4, 23, 32, 5, 'el Almendra Almond', 'single', '', 'The Natural And Healthy El Almendro Sugar Free Almond Crunchy Almond Turron Round Offers A Unique Flavour', 1, '2015-12-23 15:18:08', '2015-12-23 15:18:08'),
(41, 4, 23, 33, 5, 'Strong mints sugar free', 'single', '', 'Strong mint for refreshing taste', 1, '2015-12-23 15:20:50', '2015-12-26 20:58:08'),
(42, 8, 22, 37, 6, 'Meiji Hello Panda Biscuits ', 'single', '', 'People love our Meiji Hello Panda strawberry Cookies for school lunches, snacks and after supper treats. They''re also tasty with coffee and tea. Prepared of flaky shortbread with creamy strawberry filling, every biscuit is stamped with a playful signature panda print.', 1, '2015-12-23 15:21:16', '2015-12-23 15:21:16'),
