(44, 4, 54, 61, 5, 'Bread Brown', 'single', '', 'Daily Bread Brown Bread is a soft, fresh gluten-free brown loaf with a richly coloured crust, sprinkled with millet flakes. It has all the malt flavour and nutty texture of premium traditional granary bread. It is made with significant amounts of whole grain flour like wheat or rye and other ingredients. It is rich in essential vitamins, iron and other dietary fibres. The fibre present in brown bread takes care of your digestive system and prevents diabetes.\r\n\r\nThe health factor does not take away its taste either. You can still make your yummy paneer, spinach, corn, egg sandwiches and enjoy a good meal or snack. So, what are you waiting for? Start your diet now and buy it online with no extra cost. Convenient and affordable, Daily Bread brown bread is the apt choice for weight watchers.', 1, '2015-12-23 15:24:40', '2015-12-26 20:58:56'),
