(107, 4, 14, 69, 5, 'Almond', 'single', '', 'Almonds are light brown skinned, tough, edible seeds of the almond fruit. They have a wealthy yet subtle bitter-sweet flavor. These are assets of nutrients, especially protein, dietary fibre, mono-unsaturated fatty acids and B complex vitamins. Also, it is wealthy in vitamin E and minerals such as potassium, calcium, manganese, zinc, iron and selenium.', 1, '2015-12-23 17:03:53', '2015-12-23 17:26:24'),
(108, 4, 14, 70, 5, 'Pure ghee', 'single', '', 'A taste of purity, Nandini Ghee prepared from pure butter. It is pure and fresh with a yummy flavor. Hygienically manufactured and filled in a special pack to retain the decency of pure ghee. Nadini always ensures the flavor of purity. It is one of the most necessary products to play its vitality to a great extent in almost every cooking you prepare especially for the veg stuffs. ', 1, '2015-12-23 17:07:32', '2015-12-26 20:33:43'),
(109, 5, 18, 53, 3, 'Parachute Coconut Oil', 'multiple', '', 'Parachute coconut oil is commonly used in cooking, especially for frying. It works well in baked goods, pastries, and sautÃƒÂ©s. Parachute coconut oil is rich in Vitamin A, C, Calcium and Iron. It can be used as a skin moisturizer. It helps with dry skin and reduces protein loss when used in hair.', 0, '2015-12-23 17:07:39', '2015-12-23 17:07:39'),
(110, 8, 19, 44, 4, 'Gala Dust - Go Set', 'single', '', 'Gala Mops dust pan set with flagged bristles and leveler strip. This product is perfect for both light and heaving scrubbing and is perfect for cleaning your carpets as well. It takes away every one the dust attached to it and also removes the dirt in it.\r\n\r\nGala India''s one of largest manufacturer of home cleaning tools brings out Dustpan Made from Virgin plastic,more depth to collect more dust, leveler ensures that Dustpan can adjust on any surface to collect dust. Special brush with split bristles which enables collecting fine dust particles.', 1, '2015-12-23 17:10:25', '2015-12-23 17:10:25'),
(111, 4, 14, 71, 5, 'Makhana', 'single', '', 'Phool Makhana is a very nutritious, completely organic non-cereal food, which is widely mature in the stagnant water of wetlands, ponds lakes, tanks and ditches. It can be inspired as dry fruit snacks by roasting. ', 1, '2015-12-23 17:11:14', '2015-12-26 20:34:43'),
(112, 5, 55, 56, 3, 'Amul Buttery Spread - Garlic & Herbs', 'single', '', 'Pasteurised Table Butter, Garlic Herbs Masala (Garlic Powder, Garlic flakes, Oregano leaves, Ghee) and Salt, Contain Permitted Natural Colour [Annatto].', 0, '2015-12-23 17:11:19', '2015-12-23 17:11:19'),
(113, 8, 19, 45, 4, 'Bergner Kaiserhoff Non Stick Sauce Pan With Lid', 'single', '', 'It can be used in gas, induction, electric type of cooking, diswasher friendly,', 1, '2015-12-23 17:14:01', '2015-12-23 17:34:58'),
(114, 5, 55, 57, 3, 'Milky Mist Premium Cheese Spread - Natural', 'single', '', 'Milky Mist Premium Cheese Spread is a good a supply of milk proteins and calcium. It is very simple to use and effortless to spread. It is simple to use as a cheesy alternative to sauces, chutneys, dips and ketchups. It is great for adding delectable taste to rotis, paranthas, Omelette, dosa, kulcha, nan, samosas, pakora and several other Indian dishes.', 0, '2015-12-23 17:14:40', '2015-12-23 17:14:40'),
(115, 8, 19, 46, 4, 'Exo Dish Wash - Bar Anti Bacterial Withcyclozan', 'single', '', 'Exo Dish Shine Bar makes your vessels odorous and removes stain. The fast action formula with the hyper-cleaning technology quickly removes the toughest of stains and makes your vessels shine like never before. This dish washing bar does not leave traces on the vessel and hence it can be easily washed. It works hard on grease and stains, keeping your utensils fresh and shining. It contains many anti-microbial agents that keep your vessels away from dirt and microbes which do not create pealing or itching of your skin.', 1, '2015-12-23 17:17:17', '2015-12-23 17:17:17'),
(116, 4, 14, 72, 5, 'Rice flakes', 'single', '', 'Sri Bhagyalakshmi Thin Rice Flakes (Poha) is suitable for the food lovers to fill their stomach within extremely short timings. It is one of the best well-known foods for keeping people healthy and controlling blood pressure. It is soft, light and flat, also grey in color. ', 1, '2015-12-23 17:17:33', '2015-12-23 17:17:33'),
(117, 5, 55, 58, 3, 'danone Dahi - Plain', 'multiple', '', 'Danone Plain Dahi certainly has a lot to offer when it comes to healthy consumption. It could be a great supply of protein for vegetarians. It provides bone-building calcium, now similar to a glass of milk for those who don''t like drinking milk or lactose intolerant. It also features Vitamin B12, riboflavin and essential minerals. It is ideal for smoothies or yogurt based curries.\r\n\r\nNutritional Information per 100ml: Energy 67kcal, Protein 3.5g, Fat 3.5g, Carbohydrate 5.3g, of which Sugar 0g, Calcium 120mg.', 0, '2015-12-23 17:17:42', '2015-12-23 17:17:42'),
(118, 8, 19, 46, 4, 'Tide Detergent Powder - Talcum Fresh', 'single', '', 'Tide Plus removes tough stains. It kills germs on cloths and give fresh fragrance to cloths with talcum freshness.', 1, '2015-12-23 17:19:39', '2015-12-23 17:19:39'),
(119, 4, 14, 73, 5, 'Tata salt', 'single', '', 'Sugar is completed from organic sugar cane, the grains are light cream highlighted. It is a better option as opposed to refined sugar that is pure white in color. It is a great supply of energy and has essential minerals without harsh chemicals or additives. It is consistently crystallized and mixes well with all other food ingredients and makes your sweet dish tastier. ', 1, '2015-12-23 17:20:13', '2015-12-26 19:06:27'),
(120, 5, 55, 59, 3, 'Pantai Milk - Coconut', 'single', '', 'Pantai Coconut Milk is made from the pressing of fresh, ripe coconut meat, which extracts the oil and aromatic compounds. It has then a fat content of 17-24% depending on the fat level of the coconut meat and the quantity of added water.\r\n\r\nHOW TO USE\r\nCoconut milk is used to make ice cream, dressings, Salads, Marinades, Candy, curries, satay sauces, baked or frozen desserts, and drinks.', 0, '2015-12-23 17:22:44', '2015-12-23 17:22:44'),
(121, 5, 55, 60, 3, 'danone Buttermilk - Masala', 'single', '', 'Danone Buttermilk Masala is a mildly spiced drink made with curds. It helps in reducing sun stroke and acts as a refreshing cooling agent.\r\n', 0, '2015-12-23 17:25:04', '2015-12-23 17:25:04'),
(122, 5, 54, 61, 1, 'Fresho Burger Buns', 'single', '', 'Freshly Baked bread is one of life''s greatest simple pleasures and at Bigbasket we decided to give you just that. We start baking our breads once you order using the finest ingredients available. We do not add any chemicals or preservatives thus making these breads completely chemical free. At Bigbasket we''re passionate about making bread extra special, so we hope you''ll enjoy eating it as much as we enjoyed baking it.\r\n\r\nWe recommend you consume this bread within 2 days or refrigerate if you intend to use it longer.\r\n\r\nNo Artificial Colours, No Preservatives, Baked On Orde', 0, '2015-12-23 17:28:08', '2015-12-23 17:28:08'),
(123, 8, 19, 47, 4, 'KKV Led Bulb', 'single', '', 'Imported LED', 1, '2015-12-23 17:28:30', '2015-12-23 17:28:30'),
(124, 4, 14, 74, 5, 'Aashirvaad', 'single', '', 'Aashirvaad Whole Wheat Flour is finished from the best accepted ingredients that help recover digestion and offer good number of well nutrients to the body. Aashirvaad Whole Grain Atta does not hold any extra preservatives or flavours. 100% full Wheat Chapati Flour and no Maida added. ', 1, '2015-12-23 17:30:13', '2015-12-26 20:35:35'),
(125, 5, 54, 62, 1, 'Dezire Plum Cake - Eggless', 'single', '', 'For Health Watchers & Diabetics, A Low Glycemic Product, a natural product.', 0, '2015-12-23 17:32:28', '2015-12-23 17:32:28'),
(126, 4, 22, 34, 5, 'Hello Panda biscuits', 'single', '', 'Hello Panda are bite sized, baked biscuits, packed with milk cream. The biscuits appear in different shapes and sizes with cute drawings of the Giant Panda enjoying different sporting activities. ', 0, '2015-12-23 17:33:53', '2015-12-23 17:33:53'),
(195, 9, 20, 39, 7, 'Ooty apple', 'multiple', '', 'Fresh Imported apples', 1, '2015-12-28 16:53:56', '2015-12-29 15:29:33'),
(127, 5, 54, 63, 1, 'Parle Rusk - Real Elaich', 'single', '', 'Rusk is a hard twiced baked bread, It was originally discovered to preserve bread during the dry weather, The best way to relish this Crispy tea-time snack is to eat if after dipping it in tea or coffee.', 1, '2015-12-23 17:34:48', '2015-12-23 17:34:48'),
(128, 4, 22, 35, 5, 'Marie biscuit', 'single', '', 'Wheat Flour, Sugar, Vegetable Oil (Palam Oil), Tapioca Starch, Full Cream Milk Powder, E150, Caramel, Leavening Agent (Ammonium Bicarbonate), Salt, Glucose Syrup and Permitted Artificial Coffee Flavour. ', 0, '2015-12-23 17:37:41', '2015-12-23 17:37:41'),
(129, 5, 16, 64, 2, 'Yeturu Aloe Vera - Slim & Fit', 'single', '', 'Yeturu Muscle Rub is a â€œnatural pain relief balmâ€. Double the relief in half the time is what this deep penetrating formula has been planned for. An emollient oil-in-water lotion includes warming and cooling herbal agents that assist your muscles to loosen up and renovate their creative strength. It is a soothing balm that provides long lasting assistance to aching muscles and joints.', 1, '2015-12-23 17:38:07', '2015-12-23 17:38:07'),
