(135, 8, 18, 49, 4, 'Mee Mee A Baby Stroller', 'single', '', 'For your child’s safety and health. it is difficult to imagine the surprise and excitement of children who experience the world around them for the very first time. lying or sitting comfortably in a stroller babies first come into contact with new sounds, movements, colours and shapes. a few encouraging words from the parents will reassure these explorers during their travels. mee mee stroller is carefully made to the highest safety standards keeping baby in mind.', 1, '2015-12-23 17:44:27', '2015-12-23 17:44:27'),
