(141, 8, 18, 51, 3, 'Axe Dark Temptation Deodorant', 'single', '', 'ust Be You, A Confident Man Who Likes To Take The World By Storm And Conquer Your Dreams With Axe Dark Temptation Deodorant Bodyspray. Enriched By The Mischievous Interplay Of Seductive, Long Lasting Fragrance And Crafted For A Refreshing Beat In AxeÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢S Iconic Style, This Is A Temptation That Is Simply Irresistible. It Has The Unique Fragrance Of Chocolate And Caramel That Leans Toward Seductive Bliss, This Deodorant Has Been Designed For The Metrosexual Man To Kick Start His Day In Style. So Charm The World With Your Urban Sexiness And The Power Of Axe Dark Temptation Deodorant Bodyspray.', 1, '2015-12-23 17:52:00', '2015-12-23 17:52:00'),
(142, 5, 14, 69, 1, 'Lion Dates - Desert King', 'multiple', '', 'Lion Desert King Dates are healthy & nutritionally rich fruits enriched with the natural flavor, minerals & vitamins. The skin of the dried fruit is wrinkled and covered with a waxy film, sticky. Served mainly as desserts, these date fruits are commonly chopped into small slices & scattered across cakes and puddings to ameliorate their taste. They are useful in keeping abdominal cancer at bay.', 1, '2015-12-23 17:52:06', '2015-12-26 20:15:27'),
(143, 5, 14, 70, 1, 'Grb Ghee', 'multiple', '', 'GRB is 100% pure and provides the taste of homemade ghee. It is added with sweets, food. It also GRB ghee is added with plain rice with some salt added and is excellent to go.', 1, '2015-12-23 17:56:31', '2015-12-23 17:56:31'),
(144, 8, 18, 51, 4, 'Nivea Deodorant - Fresh Active (for Men)', 'single', '', 'Longlasting freshness ocean extracts\r\n\r\nIngredients: Butane, alcohol (94% v/v) content: Alcohol 27.65% w/w with 1% isopropyl alcohol, isobutane, propane, parfum, propylene glycol, maris limus, ostrea, Polyglyceryl-2, caprate, ethylhexylglycerin, Methyl phenylbutanol, aqua, octyldodecanol, persea gratissima oil, cetearyl ethythexanoate, butyloctanoic acid, isopropyl myristate', 1, '2015-12-23 17:56:50', '2015-12-23 17:56:50'),
(145, 3, 6, 7, 3, 'thandhuri', 'single', '', 'red thandhuri', 1, '2015-12-23 17:56:54', '2015-12-23 17:56:54'),
(146, 5, 14, 71, 1, 'Dakshin''s Spicy Cloud Powder - Sambar', 'single', '', 'It is used for cooking in many Indian recipes especially Maharashtra, Gujarat, Punjab, Rajasthan and northern Karnataka. The garlic bulb has a lot of benefits, because no other plant has been held out for so long as a cure for so many human ailments. Garlic has been used medicinally for many years for treating bites, tumors, ulcers, snakebite, wounds, headaches, heart diseases, cancer, pimples, measles and many more. It also prevents infections such as common cold, cough because of its anti-bacterial, anti-fungal and anti-viral property.', 1, '2015-12-23 18:00:05', '2015-12-23 18:00:05'),
(147, 1, 3, 4, 0, 'Oranges', 'single', '', '', 1, '2015-12-23 18:00:15', '2015-12-23 18:00:52'),
(148, 8, 18, 52, 4, 'Himalaya Shampoo - Anti Hair Fall', 'single', '', 'Himalaya Anti-Hair Fall Shampoo is a breakthrough 2-in-1 formula that nourishes hair roots and strengthens damaged hair. It has Butea Frondosa, Eclipta and the juice of the plant is applied to the scalp to support hair growth. It nourishes the hair root, improves hair texture and reduce hair fall.', 1, '2015-12-23 18:00:24', '2015-12-23 18:00:24'),
(149, 5, 14, 72, 1, 'Sri Bhagyalakshmi Rice Flakes - Thin', 'single', '', 'Sri Bhagyalakshmi Thin Rice Flakes (Poha) is suitable for the food lovers to fill their stomach within extremely short timings. It is one of the best well-known foods for keeping people healthy and controlling blood pressure. It is soft, light and flat, also grey in color.', 1, '2015-12-23 18:02:17', '2015-12-23 18:02:17'),
