(152, 5, 14, 73, 1, 'Safe Harvest Jaggery Powder', 'single', '', 'Safe Harvest Jaggery Powder is made in the traditional way from molasses from cane juice, which is slow cooked to deliver a rich, nutrient dense goodness all the way from Uttarakhand to you. With minimal processing and no bleaching, it is packed with beneficial vitamins and minerals like Iron, Calcium, Potassium and Zinc important for bone density, immunity boosting and reproductive health. Available in versatile powdered form, it can be used in a wide variety of sweet preparations as a healthy substitute to white sugar. Transfer to a clean airtight container after opening the packet to avoid lumps. All Safe Harvest products are cultivated completely devoid of synthetic chemical pesticides.', 1, '2015-12-23 18:05:11', '2015-12-23 18:05:11'),
(153, 5, 14, 74, 1, 'Manna Health Mix', 'single', '', 'Manna Health Mix to have mixture of all the vital nutrients in one meal, it is the wonderful family porridge. Manna health mix is a great mix of cereals, pulses and nuts is greatest suited for todayÃ¢â‚¬â„¢s health-conscious consumers. It is a superb resource of high quality proteins and vitamins that helps in preventing different nutrient deficiency disorders. It endorses overall fitness of the family.', 1, '2015-12-23 18:07:57', '2015-12-23 18:07:57'),
(154, 8, 55, 56, 4, 'Milky Mist Cooking Butter', 'single', '', 'Milky Mist Cooking Butter fresh cream is the most dynamic of our products, an ideal mix for both the hot curries that you make and also for the most attractive deserts. Our Cream has the best thickness that makes it a necessity for each kitchen, be it a home or the perfectionist cook''s abode.', 1, '2015-12-23 18:08:10', '2015-12-23 18:08:10'),
(155, 8, 55, 57, 6, 'Amul Cheese Spread', 'single', '', 'Milk Solids, Cheese, Common Salt, Stabilizer and Emulsifier (E-471, E331, E339) Class II Preservatives (E234, E200).\r\n\r\nNutritional Facts\r\n\r\nAmount Per 100ml, Energy Kcal 276, Energy from Fat Kcal 180, Total Fat ,g 20, Saturated Fat g 13.2, Trans Fat g 0, Cholesterol mg 70, Carbohydrate g 12.8, Added Sugar g 0.0, Sodium mg 840, Protein g 11.2.', 1, '2015-12-23 18:14:20', '2015-12-23 18:14:20'),
(156, 6, 21, 24, 5, 'Fresho Dill Leaves', 'multiple', '', 'Dill''s green leaves are flimsy and fernlike and have a spongy, sugary savor. It has a strong aroma & a quality sharp tang. The savor of dill leaves diminishes extensively the longer it is cooked. Attach it at the last minute for full savor and smell.', 1, '2015-12-23 18:16:12', '2015-12-23 18:16:12'),
