(158, 6, 21, 25, 5, 'Fresho Fresh Garlic', 'multiple', '', 'Garlic is a white, cloven, juicy, thin skinned, pungent & white fleshed, aromatic edible bulb that belongs to the lily family. Garlic is organized in a head, called the "bulb," which is completed up of separate cloves. Garlic cloves are fawn in color, and although they contain a firm texture, they can be simply cut or crushed. It also includes several falconoid anti-oxidants, contains amazingly high levels of minerals and vitamins.', 1, '2015-12-23 18:19:44', '2015-12-23 18:19:44'),
(159, 8, 55, 58, 0, 'Britannia Milk ', 'single', '', 'A healthy breakfast increases your fat burning capability and increases your energy level and metabolism for the day. It acts as brain fuel and will improve your thinking ability and boost your problem-solving and memory retention skills. It maintains you from getting too hungry and avoids overeating at lunch or dinner. Children who eat a healthy breakfast have better awareness and eye-hand co-ordination. They are also more alerting, inspired and less possible to miss school.', 1, '2015-12-23 18:21:15', '2015-12-23 18:21:15'),
(160, 8, 55, 58, 5, 'Milky Mist Yoghurt Curd', 'single', '', 'Milky Mist Yoghurt Curd is an excellent source of calcium and proteins. Prepared from higher quality pasteurized toned milk.', 1, '2015-12-23 18:23:47', '2015-12-23 18:23:47'),
(161, 6, 21, 26, 5, 'Fresho Broccoli', 'multiple', '', 'Broccoli is a green vegetable which closely resembles the cauliflower and belongs to the same family also, collectively known as cruciferous vegetables. 100 gms of broccoli contains just 35 calories.', 1, '2015-12-23 18:24:03', '2015-12-23 18:24:03'),
(162, 6, 21, 27, 5, 'Fresho Radish - Red', 'multiple', '', 'Red Radish is the root vegetable in the Brassica family. The crunch, biting taste of red radish ranges from the juicy crispness of red globe radishes to the spicy of turnip-shaped black radishes.', 1, '2015-12-23 18:27:17', '2015-12-23 18:27:17'),
