(164, 6, 21, 28, 5, 'Fresho Tapioca', 'multiple', '', 'Fresho is our brand of fresh fruits and vegetables which are individually handpicked everyday by our experienced and technically competent buyers. Our buying, storing and packaging processes are tailored to ensure that only the fresh, nutrient dense, healthy and delicious produce reaches your doorstep. We guarantee the quality of all Fresho products. If you''re not satisfied with the freshness of the items, you can hand them back to our Customer Experience Executive (CEE) for a full refund.', 1, '2015-12-23 18:30:08', '2015-12-23 18:30:08'),
