(172, 8, 16, 66, 1, 'Glucon-D Pure Glucose', 'single', '', 'Glucose Powder', 1, '2015-12-23 18:44:25', '2015-12-23 18:44:25'),
(173, 6, 23, 31, 6, 'The Belgian Chocolate Seashells', 'single', '', 'Perfect For Gifting And Alcohol Free, No Preservatives, No Colorants', 1, '2015-12-23 18:44:46', '2015-12-23 18:44:46'),
(174, 8, 16, 68, 1, 'Dezire Lemon Ginger Squash ', 'multiple', '', 'There is no better way to Beat the Summer than with Dezire Low Glycemic Sugar-Less Squashes. Available in two variants Lemon Squashes and Lemon Ginger Squash. Summers have never been cooler!', 1, '2015-12-23 18:47:01', '2015-12-23 18:47:01'),
(175, 6, 23, 32, 6, 'Delaviuda Chocolate Bar - Milk With Hazelnuts (Sugar Free)', 'single', '', 'Creamy Milk Chocolate Enveloping Crunchy Pieces Of Hazelnut, With No Added Sugars.', 1, '2015-12-23 18:48:09', '2015-12-23 18:48:09'),
(176, 6, 23, 33, 6, 'Fox Glacier Mints', 'single', '', '100% natural no artificial flavourings or colours are used. Serve the mints as breath fresheners or the sweets just like that.', 1, '2015-12-23 18:50:28', '2015-12-23 18:50:28'),
(177, 8, 14, 69, 4, 'Delicious Cashews - Tunnel Dried', 'single', '', 'Handpicked from the virgin forests & plantations across the continents of Africa and Asia, the raw are processed and individually shelled to extract the cashew Kernels, The kernels are heat treated in tunnel ovens before it is roasted and packed in inert gas flushed packing to retain freshness optimum crispness and long shelf life.', 1, '2015-12-23 18:51:27', '2015-12-23 18:51:27'),
(178, 8, 14, 74, 5, 'Annapurna Atta', 'single', '', 'Annapurna Atta is made from choicest of grains brought fresh from the farms, cleaned three times and ground and packed in the most clean conditions to give you soft appetizing rotis that simply melt in the mouth. It absorbs additional water while kneading, makes rotis stay smooth for a longer time and contains the full nutrition of minerals and vitamins of wheat grains.', 1, '2015-12-23 18:53:44', '2015-12-23 18:53:44'),
(179, 6, 22, 34, 3, 'Cadbury Cookies - Rich T', 'single', '', 'Chocolate covered tea time biscuits that are dunked into tea or coffee and used as a small snack.Made with high quality ingredients such as wheat flour, sugar and malt extract.', 1, '2015-12-23 18:54:10', '2015-12-23 18:54:10'),
(180, 8, 14, 73, 4, 'Saffola Salt - Less Sodium', 'single', '', 'Saffola Less Sodium Salt is also recognized as Saffola salt plus as an improved substitute to regular table salt. Saffola Less Sodium Salt contains lesser sodium levels when compared to ordinary salts and a better level of potassium. It can be used as ordinary salt to add a pinch of health with your each day meal.', 1, '2015-12-23 18:56:01', '2015-12-23 18:56:01'),
(181, 6, 22, 35, 3, 'Matilde Vicenzi Gran Rustico - Digestive Biscuit', 'single', '', 'Tasty, buttery, crunchy cookies, My Ciambelle today, as in the old days are cooked slowly and then packaged still hot so as to maintain their fragrance and taste.', 1, '2015-12-23 18:56:52', '2015-12-23 18:56:52'),
(182, 6, 22, 36, 3, 'Gourmets Delite Gourmets Delite Wafers - Orange', 'single', '', 'heat Flour (33%), Sugar (29%), Edible Vegetable Fat (19%), Edible Starch (14%), Edible Vegetable Oil, Glucose, Emulsifier(INS 322), Edible Common Salt, Acidity Regulator (E330), Raising Agents [INS 500(II) & 503(II), Dough Conditioner (INS 223), Contains Permitted Synthetic Food Colour (INS 124), Contain Added Flavour-Artificial Flavouring Substance (Strawberry).', 1, '2015-12-23 18:59:27', '2015-12-23 18:59:27'),
(183, 8, 14, 72, 4, 'BB Royal Jeeraga Samba Rice/Seeraga Samba Arisi', 'single', '', 'Jeera Rice Or Zeera Rice Is An Indian Dish Consisting Tiny Size. It Is A Famous Dish In North India, An Everyday Rice Dish. It Is Simple To Prepare Unlike A Biryani. It Is Finely Processed To Eliminate Foreign Grains, Dust Particles, Husk And Other Impurities. It Contains A Good Nutritional Value And High In Taste.', 1, '2015-12-23 18:59:42', '2015-12-23 18:59:42'),
(184, 6, 22, 37, 3, 'Meiji Yan Yan Dip Buscuit - Creamy Chocolate Flavored', 'single', '', 'These yummy Velvety Chocolate biscuits are enormous for snacks, and their convenient size creates them perfect for school lunchboxes. They are lesser in sugar than many other biscuit brands and nutritionally filled with fiber, an enormous benefit for children and families.', 1, '2015-12-23 19:02:43', '2015-12-23 19:02:43'),
(185, 8, 14, 71, 1, 'Aachi Masala - Kulambu Chilly', 'single', '', 'Aachi Kulambu Chilly Masala is made from fresh and natural ingredients in accurate compositions. This masala is acclaimed for its high aroma, brilliant ability and freshness to add an extra flavour to your food which is recognized for its mouthwatering taste process to make sure for accurate quality, composition and purity.', 1, '2015-12-23 19:05:09', '2015-12-26 18:33:13'),
(186, 6, 22, 38, 3, 'Mcvities Biscuits - Fruit Shortcake (with Currants)', 'single', '', 'McVities Fruit Shortcake is a tasty crumbly shortbread biscuit filled full of currants. These biscuits are a perfect snack any time of the day. They are sweet and crispy and filled full of currants.', 1, '2015-12-23 19:05:22', '2015-12-23 19:05:22'),
(187, 8, 14, 71, 0, 'MTR Masala Paste - Puliogare Paste', 'single', '', 'MTR Masala Paste - Puliogare Paste make the yummy tamarind (imli) rice with peanuts in the valid South Indian flavor tasty and peppery. MTR Daily Favorite is your reliable partner in the kitchen that assists you makes your family''s each day meal tasty and healthy. It can be utilized for preparing flavorful macaroni & vermicelli. Serve with curd, papad, coconut chutney.', 1, '2015-12-23 19:07:11', '2015-12-23 19:07:11'),
(188, 6, 20, 39, 7, 'Fresho Apple - Kinnaur', 'multiple', '', 'Fresho is our brand of fresh fruits and vegetables which are individually handpicked everyday by our experienced and technically competent buyers. Our buying, storing and packaging processes are tailored to ensure that only the fresh, nutrient dense, healthy and delicious produce reaches your doorstep. We guarantee the quality of all Fresho products. If you''re not satisfied with the freshness of the items, you can hand them back to our Customer Experience Executive (CEE) for a full refund. Royal gala apples are bright red, thin skinned, white fleshed fruits with a mild sweet flavour and are native to New Zealand.', 1, '2015-12-23 19:08:41', '2015-12-23 19:08:41'),
(189, 6, 20, 40, 7, 'Fresho Banana - Red', 'multiple', '', 'Fresho is our brand of fresh fruits and vegetables which are individually handpicked everyday by our experienced and technically competent buyers. Our buying, storing and packaging processes are tailored to ensure that only the fresh, nutrient dense, healthy and delicious produce reaches your doorstep. We guarantee the quality of all Fresho products. If you''re not satisfied with the freshness of the items, you can hand them back to our Customer Experience Executive (CEE) for a full refund.', 1, '2015-12-23 19:11:25', '2015-12-23 19:11:25'),
(190, 8, 14, 70, 1, 'Gold winner - Sunflower Oil', 'single', '', 'Sun Land Refined Sunflower Oil Is Odorless, Light And Nearly Flavorless Oil Pressed From Sunflower Seeds, It Creates Your Food Tasty And Maintains You Healthy.', 1, '2015-12-23 19:11:29', '2015-12-26 18:39:56'),
(191, 6, 20, 41, 7, 'Fresho Kiwi', 'single', '', 'Kiwi fruit, also identified as Chinese gooseberry or Macaque peach, is the general fruit of China. The flesh in cross section is very fine-looking and beautiful. It is dazzling green in color, with frequent soft small ripe seeds. The fruit has a delicate savor with a pleasant smell. The sugary fruit flavors like a mixture of strawberry, pineapple and banana.', 1, '2015-12-23 19:16:10', '2015-12-23 19:16:10'),
(192, 6, 20, 42, 7, 'Fresho Imported Orange - Naval', 'multiple', '', 'Navel oranges are very sugary and juicy and considered to be the world''s best orange for fresh consumption because they are naturally juice, very sweet, seedless and peels and segments very easily. It includes a variety of phytochemicals including flavanoids hesperetin, carotenoids alpha and beta-carotene, etc. It is wealthy in Vitamin C, A and Folate and includes small amounts of Vitamin B & E complex vitamins too.', 1, '2015-12-23 19:19:03', '2015-12-23 19:19:03'),
(193, 6, 20, 43, 7, 'Fresho Water Melon Kiran', 'single', '', 'Watermelon Kiran is sugary, juicy with a grainy texture. It is wealthy in electrolytes & water. It brings more nutrients per calorie making it an outstanding health product. It is wealthy in photonutrients including anti-oxidant flavonoids. It is an excellent source of potassium & manganese and it is an outstanding source of Vitamin A, includes a good amount of thiamin (vitamin B-1), vitamin-B6 (pyridoxine), and vitamin-C.', 1, '2015-12-23 19:25:16', '2015-12-23 19:25:16'),
(194, 1, 3, 4, 0, 'Mixed fruits', 'multiple', '', '', 1, '2015-12-25 18:24:40', '2015-12-25 19:00:35');
